import React from "react";
import Header from "./Components/Header";
import { Container, Form } from "react-bootstrap";
import Footer from "./Components/Footer";
import Menu from "./Components/Menu";

const App = () => {
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <Menu />
        </Container>
      </main>
      <Footer/>
    </>
  );
};

export default App;
